import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import PhoneticsList from "../";
import ExampleOfPhonetic from "./Components/ExampleOfPhonetic";
function App() {
  return (
    <div className="App">
         <Router>
        <Switch>
          <Route path="/">
            <PhoneticsList />
          </Route>
          <Route exact path="/examples/:name">
            <ExampleOfPhonetic />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
